import React, { useState, useEffect, useContext } from 'react';
import '../components/style/style.css'

import logo from "../img/logo.png"
import logoSimples from "../img/logoSimples.png"
import StoreContext from '../components/Store/Context';


function createRandomUsers(count = 5) {
  const users = [];
  
  for (let i = 0; i < count; i++) {
    users.push({
      userId: i + 120,
      cpf: "123456789 -0" + i,
      name: "Funcionario " + i,
      funcao : "Operador",
      salario: 1417.25,
      dataInicio: '01-01-2024',
      horaIntervalo: '12:30'
    });
  }

  return users;
}

function Departamento({userData}){
  const [tableData, setTableData] = useState([]);
  const [show, setShow] = useState(0);
  const { setToken, token } = useContext(StoreContext);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      /*
      const response = await fetch("https://cities-qd9i.onrender.com/agents");
      const agents = await response.json();
      
      setTableData(agents);
      */
     console.log(tableData);
    } catch (error) {
      console.error("Error fetching data:", error);
    }
  };

  const handleCreateUsers = () => {
    const newUsers = createRandomUsers()
    setTableData([...tableData, ...newUsers])
  }

  const handleClearUsers = () => {
    setTableData([]);
  }

  const createFuncionario = () => {
    setShow(1);
  }

  const closeForm = () => {
    setShow(0);
  }
  
  const handleInputChange = (event) => {
    const { name, value } = event.target;
    setVenda((prevData) => ({
      ...prevData,
      [name]: value,
    }));
};

  const handleSubmit = (event) => {
    event.preventDefault();
    
    /*axios.post('http://127.0.0.1:5000/api/sendDados', formData)
      .then(response => {
        console.log('Resposta do servidor:', response.data);
      })
      .catch(error => {
        console.error('Erro ao enviar dados:', error);
      });*/
  };

    return (
        <div className="mform">
        <div className = "text">Funcionários</div>
      <button className= "update-btn" onClick={handleCreateUsers}>Create Users</button>
      <button className= "delete-btn" onClick={handleClearUsers}>Delete Users</button>
      <button className= "update-btn" onClick={createFuncionario}>Add User</button>
      <div class="table">
      <div class="table-header">
          
      <div class="header__item">
        <a id="idFunc" class="filter__link">
          ID</a>
        </div>
        <div class="header__item">
          <a id="cpf" class="filter__link filter__link--number" >
            CPF
          </a>
          </div>
          <div class="header__item">
          <a id="nome" class="filter__link filter__link--number">
            Funcionário</a>
          </div>
          <div class="header__item">
          <a id="funcao" class="filter__link filter__link--number">
            Função</a>
          </div>
          <div class="header__item">
          <a id="salario" class="filter__link filter__link--number">
            Salário</a>
          </div>
          <div class="header__item">
          <a id="dataInicio" class="filter__link filter__link--number">
            Data Início</a>
          </div>
          <div class="header__item">
          <a id="horaIntervalo" class="filter__link filter__link--number">
            Hora de Intervalo</a>
          </div>

        </div>
        <div class="table-content">
          {
            tableData.map((obj) => {
              return (
                <div class="table-row">
                  <div class="table-data">{obj.userId}</div>
                  <div class="table-data">{obj.cpf}</div>
                  <div class="table-data">{obj.name}</div>
                  <div class="table-data">{obj.funcao}</div>
                  <div class="table-data">{obj.salario}</div>
                  <div class="table-data">{obj.dataInicio}</div>
                  <div class="table-data">{obj.horaIntervalo}</div>
                </div>
              );
            })
          }
        </div>
      </div>
      <form onSubmit={handleSubmit}>
           
           <div className='form-all'>
             <div class = "text">
               Abrir Chamado
             </div>
             <div class="form-row">
             <div class="input-data">
               <input 
                       name="userId" 
                       className='dadosUser' 
                       value={formData.userId}
                       onChange={handleInputChange} required/>
                       <div class="underline"></div>
                   <label for="userId">
                   ID Funcionario
                   </label>
             </div>
             <div class="input-data">
               <input 
                       name="cpf" 
                       className='dadosUser' 
                       value={formData.cpf}
                       onChange={handleInputChange} required/>
                       <div class="underline"></div>
                   <label for="cpf">
                   CPF
                   </label>
             </div>
             <div class="input-data">
                 <input 
                       name="name" 
                       className='dadosUser' 
                       value={formData.name}
                       onChange={handleInputChange} required/>
                 <div class="underline"></div>
               <label for="name">
                   Nome
                   
               </label>    
               </div>
               
               <div class = "input-data">
                 <input 
                       name="funcao" 
                       className='dadosUser' 
                       value={formData.funcao}
                       onChange={handleInputChange} required />
                 <div class="underline"></div>
